import React, { useEffect, useState } from 'react';

const PaperList = () => {
  const [papers, setPapers] = useState([]);

  useEffect(() => {
    fetchPapers();
  }, []);

  const fetchPapers = async () => {
    try {
      const response = await fetch('\'http://localhost:5000/page-rank'); // Replace with your backend API endpoint
      const data = await response.json();
      setPapers(data);
    } catch (error) {
      console.error('Error fetching papers:', error);
    }
  };

  const sortedPapers = papers.sort((a, b) => b.pageRank - a.pageRank);

  return (
    <div>
      <h2>List of Papers with Best Page Rank</h2>
      {papers.length > 0 ? (
        <ul>
          {sortedPapers.map(paper => (
            <li key={paper.id}>
              <strong>{paper.title}</strong> - Page Rank: {paper.score}
            </li>
          ))}
        </ul>
      ) : (
        <p>Loading papers...</p>
      )}
    </div>
  );
};

export default PaperList;
